import React from "react";
import image from '../assets/imgs/IT.jpeg'

export default function About({ headerHeight }) {
    return (
        <div className="h-[calc(100vh-64px)]">
            <img src={image} alt="IT" className="object-cover" />
        </div>
    )
}
